const api_key = '257fa2b9-b85d-471b-ab08-eab1e877a247'

function getNumberRandom(n = 10) {
  value = Math.pow(10, n) - 1
  return Math.floor(Math.random() * value) + 1;
}
//================================================================================
// genera un UUID
//================================================================================
function generateUUID() {
  var d = new Date().getTime();
  var d2 = ((typeof performance !== 'undefined') && performance.now && (performance.now() * 1000)) || 0;
  return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
    var r = Math.random() * 16;
    if (d > 0) {
      r = (d + r) % 16 | 0;
      d = Math.floor(d / 16);
    } else {
      r = (d2 + r) % 16 | 0;
      d2 = Math.floor(d2 / 16);
    }
    return (c === 'x' ? r : (r & 0x3 | 0x8)).toString(16);
  });
}

//================================================================================
// genera la fecha actual en formato solicitado
//================================================================================
function getDateContract(mode = 'd-m-a') {
  d = new Date()
  year = String(d.getUTCFullYear())
  month = String(d.getUTCMonth() + 1)
  month = d.getUTCMonth() < 10 ? ('0' + month) : month
  day = String(d.getDate())
  day = d.getDate() < 10 ? ('0' + day) : day
  ret = year + month + day
  if (mode === 'd-m-a')
    ret = day + '-' + month + '-' + year
  if (mode === 'a-m-d')
    ret = year + '-' + month + '-' + day
  return ret
}
//================================================================================
// Consume servicios webservice de la creccu-api
//================================================================================
async function soap(path = '', dataTx = '', componente) {
  area = document.getElementById(componente)
  url_ws = 'https://lbqa.ionix.cl/services/creccu-api/soap' + path + '?wsdl'
  objXMLHttpRequest = new XMLHttpRequest()
  objXMLHttpRequest.open('POST', url_ws, false)
  objXMLHttpRequest.setRequestHeader("Content-Type", "text/xml; charset=utf-8")
  objXMLHttpRequest.send(dataTx)
  response = new XMLSerializer().serializeToString(objXMLHttpRequest.responseXML)
  area.value = response
  return response
}

//================================================================================
// realiza la consulta al servicio REST
//================================================================================
async function apiRequest(path = '', dataTx = {}, method = 'POST', key = '') {
  console.info('Path  : ', path)
  console.info('DataTx: ', JSON.stringify(data))
  // Alerta 
  document.getElementById("msgError").hidden = true
  response = await fetch(path, {
    method: method, // GET, POST, PUT, DELETE, etc.
    mode: 'cors',   // no-cors, *cors, same-origin
    // cache: 'no-cache', // * default, no-cache, reload, force-cache, only-if-cached
    // credentials: 'same-origin', // include, *same-origin, omit
    headers: {
      'Content-Type': 'application/json',
      'api_key': key
    },
    // redirect: 'follow', // manual, *follow, error
    // referrerPolicy: 'no-referrer', // no-referrer, *no-referrer-when-downgrade, origin, origin-when-cross-origin, same-origin, strict-origin, strict-origin-when-cross-origin, unsafe-url
    body: JSON.stringify(dataTx) // body data type must match "Content-Type" header
  }).catch(error => {
    console.error('Error detectado:', error)
    document.getElementById("msgError").hidden = false
  });
  return response
}

//================================================================================
// Requests especificos
//================================================================================
async function uccRequest(path, data, componente) {
  area = document.getElementById(componente)
  response = await apiRequest( 'https://lbqa.ionix.cl/services' + path, data, 'POST', api_key )
  dataRx = null
  if (response.ok && response.status == 200) {        
    data = await response.json()
    console.info('DataRx: ', JSON.stringify(data))
    if (data != null && data.code == 'OK') {
      console.log('Result 1: ', data.result)
      area.value = JSON.stringify(data.result)
      dataRx = data.result
    } else if (data != null && data.codError == 0) {
      console.log('Result 2: ', data.result)
      if (data.result != null) {
        area.value = JSON.stringify(data.result)
        dataRx = data.result
      }
    } else {
      console.log("Respuesta http 200, pero la data no es lo que esperamos ... ")
      document.getElementById("msgError").hidden = false
      area.value = JSON.stringify(data)
      dataRx = data
    }
  } else {
    console.warn('Response: ', response)
  }
  return dataRx
}

