async function servicesSubmit() {
  document.getElementById('msgError').hidden = true
  document.getElementById('ccaSpinner').hidden = false

  service = document.getElementById("submitServices").value

  if (service === '---') {
    document.getElementById('msgError').hidden = false
    return
  }
  rutsd = document.getElementById('ccaRut').value
  rutsd = rutsd.substr(0, rutsd.indexOf('-'));
  json = {
    clientRut: parseInt(rutsd),
    amount: parseInt(document.getElementById('buyAmount').value),
  }

  if (service === 'submitSuspension') {
    json.orderNumber = parseInt(document.getElementById('buyOrder').value),
      json.sequenceCode = parseInt(document.getElementById('buySecuence').value),
      json.date = new Date().toISOString(),
      json.authorizationCode = document.getElementById('buyAuthCode').value
  }

  if (service === 'submitCreditNote') {
    json.documentNumber = parseInt(document.getElementById('buyDocument').value),
      json.invoiceDocumentNumber = parseInt(document.getElementById('buyInvoice').value),
      json.date = new Date().toISOString(),
      json.authorizationCode = document.getElementById('buyAuthCode').value
  }

  if (service === 'submitInvoice') {
    json.documentNumber = parseInt(document.getElementById('buyDocument').value),
      json.authorizationCode = document.getElementById('buyAuthCode').value
  }

  document.getElementById('creccuapiRequest').value = JSON.stringify(json)
  document.getElementById('creccuapiResponse').value = ''
  response = await uccRequest(path = '/creccu-api/rest/' + service, data = json, componente = 'creccuapiResponse')
  if (response != null) {
    if (response.authorizationCode != null) {
      document.getElementById('buyAuthCode').value = response.authorizationCode
    }
    if (response.requestNumber != null) {
      document.getElementById('requestNumber').value = response.requestNumber
    }
    if (response.balance != null) {
      document.getElementById('buyBalance').value = response.balance
    }
  }
  document.getElementById('ccaSpinner').hidden = true
}

async function buyServicesMethod() {
  document.getElementById('msgError').hidden = true
  document.getElementById('ccaSpinner').hidden = false

  var service = document.getElementById("buyServices").value

  if (service === '---') {
    document.getElementById('msgError').hidden = false
    return
  } else if (service === '/ApprovalService') {
    reqNumber = document.getElementById('buySalesman').value + '|' + String(getNumberRandom(20))
    document.getElementById('requestNumber').value = reqNumber
    request = '<soapenv:Envelope xmlns:soapenv="http://schemas.xmlsoap.org/soap/envelope/" xmlns:soap="http://soap.creccu.ionix.cl/"><soapenv:Header/><soapenv:Body><soap:approve><apiKey>' + api_key + '</apiKey><clientRut>' + document.getElementById('ccaRut').value + '</clientRut><salesmanCode>' + document.getElementById('buySalesman').value + '</salesmanCode><requestNumber>' + reqNumber + '</requestNumber><amount>' + document.getElementById('buyAmount').value + '</amount><financeProductCode>NORM</financeProductCode></soap:approve></soapenv:Body></soapenv:Envelope>'
    document.getElementById('creccuapiRequest').value = request
    document.getElementById('creccuapiResponse').value = ''
    response = await soap(path = service, dataTx = request, componente = 'creccuapiResponse')

  } else {
    reqNumber = document.getElementById('requestNumber').value
    if (service === 'approve')
      reqNumber = document.getElementById('buySalesman').value + '|' + String(getNumberRandom(20))
    document.getElementById('requestNumber').value = reqNumber

    json = {
      clientRut: document.getElementById('ccaRut').value,
      salesmanCode: document.getElementById('buySalesman').value,
      requestNumber: reqNumber,
      authorizationCode: document.getElementById('buyAuthCode').value,
      amount: parseInt(document.getElementById('buyAmount').value),
      financeProductCode: "NORM"
    }

    if (service === 'approve') {
      json.authorizationCode = undefined
    }

    if (service === 'modificationBalance' || service === 'sync/delete') {
      json.amount = undefined
      json.financeProductCode = undefined
    }

    if (service === 'submitCharge' || service === 'submitPayment') {
      json.comment = document.getElementById('buyComment').value
      json.accountNumber = 0
      json.authorizationCode = undefined
      json.financeProductCode = undefined
      json.salesmanCode = undefined
      json.requestNumber = undefined
    }
    if (service === 'submitMultiplePay') {
      mounts = document.getElementById('buyAmount').value
      mounts = mounts.split(', ')
      list = []
      mounts.forEach(value => {
        list.push({
          amount: value,
          accountNumber: 0,
          comment: document.getElementById('buyComment').value
        })
      });
      json = {
        clientRut: document.getElementById('ccaRut').value,
        detail: list
      }
    }

    document.getElementById('creccuapiRequest').value = JSON.stringify(json)
    document.getElementById('creccuapiResponse').value = ''
    response = await uccRequest(path = '/creccu-api/rest/' + service, data = json, componente = 'creccuapiResponse')
    if (response != null) {
      if (response.authorizationCode != null) {
        document.getElementById('buyAuthCode').value = response.authorizationCode
      }
      if (response.requestNumber != null) {
        document.getElementById('requestNumber').value = response.requestNumber
      }
      if (response.balance != null) {
        document.getElementById('buyBalance').value = response.balance
      }
    }
  }
  document.getElementById('ccaSpinner').hidden = true
}

function buySelect() {
  service = document.getElementById('buyServices').value
  if (service === 'submitCharge')
    document.getElementById('buyComment').value = 'SUBMIT'
  if (service === 'submitPayment')
    document.getElementById('buyComment').value = 'PAYMENT'
  if (service === 'submitMultiplePay') {
    document.getElementById('buyComment').value = 'MULTI_PAYMENT'
    document.getElementById('buyAmount').value = '500, 1000, 1500'
  }

}

