async function execServiceClient() {
  document.getElementById('msgError').hidden = true
  document.getElementById('ccaSpinner').hidden = false
  service = document.getElementById('ccaService').value
  if (service === '---') {
    document.getElementById('msgError').hidden = false
    return
  } else if (service === '/BalanceService') {
    request = '<soapenv:Envelope xmlns:soapenv="http://schemas.xmlsoap.org/soap/envelope/" xmlns:soap="http://soap.creccu.ionix.cl/"><soapenv:Header/><soapenv:Body><soap:balance><apiKey>' + api_key + '</apiKey><clientRut>' + document.getElementById('ccaRut').value + '</clientRut></soap:balance></soapenv:Body></soapenv:Envelope>'
    document.getElementById('creccuapiRequest').value = request
    document.getElementById('creccuapiResponse').value = ''
    response = await soap(path = service, dataTx = request, componente = 'creccuapiResponse')

  } else if (service === 'enrolledBySalesman') {
    json = {
      salesmanCode: document.getElementById('buySalesman').value,
      startDate: '2020-04-20',
      endDate: getDateContract('a')
    }
    document.getElementById('creccuapiRequest').value = JSON.stringify(json)
    document.getElementById('creccuapiResponse').value = ''
    await uccRequest(path = '/creccu-api/rest/' + service, data = json, componente = 'creccuapiResponse')
  }
  else {
    json = {
      clientRut: document.getElementById('ccaRut').value
    }
    document.getElementById('creccuapiRequest').value = JSON.stringify(json)
    document.getElementById('creccuapiResponse').value = ''
    await uccRequest(path = '/creccu-api/rest/' + service, data = json, componente = 'creccuapiResponse')
  }
  document.getElementById('ccaSpinner').hidden = true
}
