async function execServiceClients() {
  document.getElementById('ccaSpinner').hidden = false
  service = document.getElementById('ccaServicesClients').value
  if (service === '---') {
    document.getElementById('msgError').hidden = false
    return
  }
  ruts = document.getElementById('ccaRuts').value
  json = {
    salesmanCode: document.getElementById('ccaSalesman').value,
    ruts: ruts.split(', ')
  }
  document.getElementById('creccuapiRequest').value = JSON.stringify(json)
  document.getElementById('creccuapiResponse').value = ''
  response = await uccRequest(path = '/creccu-api/rest/' + service, data = json, componente = 'creccuapiResponse')
  if (response != null) {
    document.getElementById('btnCredit').disabled = (response.communes == null || response.cities == null)
    document.getElementById('btnGenerate').disabled = (response.communes == null || response.cities == null)
    if (response.communes != null) {
      selector = document.getElementById("ccaCommunes")
      for (var i = 0; i < response.communes.length; i++) {
        selector.innerHTML += "<option value='" + response.communes[i].communeCode + "'> " + response.communes[i].communeName + " </option>";
      }
    }
    if (response.cities != null) {
      selector = document.getElementById("ccaCities")
      for (var i = 0; i < response.cities.length; i++) {
        selector.innerHTML += "<option value='" + response.cities[i].cityCode + "'> " + response.cities[i].cityName + " </option>";
      }
    }
  }
  document.getElementById('ccaSpinner').hidden = true
}

